    <!-- <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.6.4/jquery.min.js"></script> -->
    <script>
        $(document).ready(function($) {
            var timer = setInterval(function() {
                getPackagePrice("MYR", "GOLDACCOUNT")
            }, 10000);
        });

        function getPackagePrice(currencyCode, packageCode) {
            $.get('/goldprice_qm', {
                currencyCode: currencyCode,
                packageCode: packageCode,
            }, function(data) {
                // handle success response from server
                PackagePriceServiceSucceededs(data);
            }).fail(returnGetPackagePriceResult);
        }

        //fail handler: display error when jQuery AJAX of getPackagePrice fail / error.
        function returnGetPackagePriceResult(result) {
            alert('Service call failed: ' + result.status + '' + result.statusText);
            Type = null;
            varUrl = null;
            Data = null;
            ContentType = null;
            DataType = null;
            ProcessData = null;
        }

        function PackagePriceServiceSucceededs(result) {
            var returnGsaResult = result.GetPriceResult;
            $('.gold-bar-price td').remove();
            $.each(returnGsaResult.PackagePrices, function(index, value) {
                if (value.code == "QMGSA") {
                    $(".gsa-sell-gram").text(value.currency + " " + numberWithCommas(value.ISellTotal.toFixed(2)));
                    $(".gsa-buy-gram").text(value.currency + " " + numberWithCommas(value.IBuyTotal.toFixed(2)));
                    $(".currency-rate").text("USD 1 = " + value.currency + " " + numberWithCommas(value.SellRate.toFixed(3)));
                    $(".update-date").text(value.UpdateDT.toLocaleString("dd MMM yyyy"));
                } else if (value.code == "GAE5X" || value.code == "QM1X5") {
                    $(".oneX5-sell-unit").text(value.currency + " " + numberWithCommas(value.ISellUnit.toFixed(2)));
                    $(".oneX5-sell-gram").text(value.currency + " " + numberWithCommas(value.ISellTotal.toFixed(2)));
                    $(".oneX5-buy-gram").text(value.currency + " " + numberWithCommas(value.IBuyTotal.toFixed(2)));
                    $(".oneX5-finance-fees").text(value.currency + " " + numberWithCommas(value.FinanceFees.toFixed(2)));
                    $(".update-date").text(value.UpdateDT.toLocaleString("dd MMM yyyy"));
                } else if (value.code == "GAE10X" || value.code == "QM1X10") {
                    $(".oneX10-sell-unit").text(value.currency + " " + numberWithCommas(value.ISellUnit.toFixed(2)));
                    $(".oneX10-sell-gram").text(value.currency + " " + numberWithCommas(value.ISellTotal.toFixed(2)));
                    $(".oneX10-buy-gram").text(value.currency + " " + numberWithCommas(value.IBuyTotal.toFixed(2)));
                    $(".oneX10-finance-fees").text(value.currency + " " + numberWithCommas(value.FinanceFees.toFixed(2)));
                    $(".update-date").text(value.UpdateDT.toLocaleString("dd MMM yyyy"));
                } else if (value.code == "QMGC") {
                    $(".gc-min-purchase").text(value.currency + " " + numberWithCommas(value.MinumumPurchase.toFixed(2)));
                } else {
                    $('.gold-bar-price').append('<tr align="center"><td>' + value.name + '</td><td>' + removeUnusedPrecision(value.weight) + '</td><td>' + numberWithCommas(value.ISellTotal.toFixed(2)) + '</td><td>' + numberWithCommas(value.IBuyTotal.toFixed(2)) + '</td></tr>');
                    //$(".update-date").text(value.UpdateDT.toLocaleString("dd MMM yyyy"));
                }
                $(".live").text("USD " + numberWithCommas(returnGsaResult.SpotPrice.toFixed(2)));

            });
        }

        function numberWithCommas(x) {
            var parts = x.toString().split(".");
            parts[0] = parts[0].replace(/\B(?=(\d{3})+(?!\d))/g, ",");
            return parts.join(".");
        }

        function removeUnusedPrecision(x) {
            var str = x.toString()
            if (str.includes(".")) {
                var parts = x.toString().split(".");
                var precisionPart = parts[1].toString().split(" (");
                if (precisionPart[0] == "000") {
                    parts[1] = parts[1].replace("000", "");
                    str = parts.join("");
                } else {
                    str = parts.join(".");
                };
            };
            return str;
        }
    </script>
